import React from 'react'
import {Form,Input,Button} from 'antd';

const FormItem = Form.Item;

function Forms() {
  return (
    <div>
      <Form>
        <FormItem label="Project Title">
            <Input placeholder='Title' />
        </FormItem>
      </Form>
    </div>
  )
}

export default Forms
